INSERT INTO [ontology] VALUES (270047,'IEV','1','0','Event (INOH)','','http://obo.cvs.sourceforge.net/obo/obo/ontology/genomic-proteomic/event.obo','A structured controlled vocabulary of pathway centric biological processes. This ontology is a INOH pathway annotation ontology, one of a set of ontologies intended to be used in pathway data annotation to ease data integration. This ontology is used to annotate biological processes, pathways, sub-pathways in the INOH pathway data.','2/20/2010 12:00:00 AM','Wed Oct 03 16:20:00 BST 2007')
