INSERT INTO [ontology] VALUES (274004,'FMA','1','0','Foundational Model of Anatomy Ontology','','http://obo.svn.sourceforge.net/viewvc/*checkout*/obo/fma-conversion/trunk/fma_obo.obo','The FMA is concerned with the concepts necessary for the symbolic representation of the phenotypic structure of the human body.','2/23/2010 12:00:00 AM','Fri Sep 15 13:29:00 BST 2006')
