INSERT INTO [ontology] VALUES (373003,'FBsp','1','0','Fly taxonomy','','http://obo.cvs.sourceforge.net/obo/obo/ontology/taxonomy/fly_taxonomy.obo','The taxonomy of the family Drosophilidae (largely after Baechli) and of other taxa referred to in FlyBase.','5/19/2010 12:00:00 AM','Fri Apr 06 11:47:00 BST 2007')
