INSERT INTO [ontology] VALUES (568004,'PW','1','0','Pathway Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/genomic-proteomic/pathway.obo','The Pathway Ontology is a controlled vocabulary for pathways that provides standard terms for the annotation of gene products. The Pathway Ontology is under development at Rat Genome Database.','11/16/2010 12:00:00 AM','Fri Nov 12 17:21:00 GMT 2010')
INSERT INTO [ontology] VALUES (658001,'REX','1','0','Physico-Chemical Process','','http://obo.cvs.sourceforge.net/obo/obo/ontology/physicochemical/rex.obo','REX is an ontology of physico-chemical processes, i.e. physico-chemical changes occurring in course of time. REX includes both microscopic processes (involving molecular entities or subatomic particles) and macroscopic processes. Some biochemical processes from Gene Ontology (GO Biological process) can be described as instances of REX.','2/8/2011 12:00:00 AM','Fri Jan 05 09:19:00 GMT 2007')
