INSERT INTO [ontology] VALUES (1716004,'FBbt','1','0','Drosophila Gross Anatomy','http://www.flybase.org/cgi-bin/cvreport.html?id={0}','https://svn.code.sf.net/p/fbbtdv/code/fbbt/releases/fbbt-simple.obo','A structured controlled vocabulary of the anatomy of Drosophila melanogaster.','7/22/2013 12:00:00 AM','Wed Jul 10 13:39:00 BST 2013')
INSERT INTO [ontology] VALUES (1821001,'OPL','1','0','Ontology of Parasite Life Cycle','','http://www.berkeleybop.org/ontologies/opl.obo','The Ontology for Parasite LifeCycle (OPL) is designed to serve as a reference ontology for parasite life cycle stages. It models the life cycle stage details of various parasites, including Trypanosoma sp., Leishmania major, and Plasmodium sp., etc. In addition to life cycle stages, the ontology also models necessary contextual details, such as host information, vector information, and anatomical location','10/24/2013 12:00:00 AM','Thu Oct 24 11:35:33 BST 2013')
