INSERT INTO [ontology] VALUES (1913001,'HP','1','0','Human phenotype ontology','','http://compbio.charite.de/hudson/job/hpo/lastStableBuild/artifact/ontology/release/hp.obo','The Human Phenotype Ontology is being developed to provide a structured and controlled vocabulary for the phenotypic features encountered in human hereditary and other disease. Our goal is to provide resource for the computational analysis of the human phenome, with a current focus on monogenic diseases listed in the Online Mendelian Inheritance in Man (OMIM) database, for which annotations are also provided.','1/14/2014 12:00:00 AM','Tue Jan 14 08:27:00 GMT 2014')
