INSERT INTO [ontology] VALUES (2111011,'CL','1','0','Cell Type','','http://cell-ontology.googlecode.com/svn/trunk/src/ontology/cl.obo','The Cell Ontology is designed as a structured controlled vocabulary for cell types. This ontology was constructed for use by the model organism and other bioinformatics databases, where there is a need for a controlled vocabulary of cell types. This ontology is not organism specific; indeed it includes cell types from prokaryotes to mammals, including plants and fungi. A full description of the Cell Ontology can be found in Bard, Rhee and Ashburner. 2005. An Ontology for Cell Types.','7/14/2014 12:00:00 AM','Mon Jul 14 05:35:34 BST 2014')
INSERT INTO [ontology] VALUES (2150003,'PATO','1','0','Phenotypic qualities (properties)','','http://obo.cvs.sourceforge.net/obo/obo/ontology/phenotype/quality.obo','Attributes and values for describing phenotypic data.','8/16/2014 12:00:00 AM','Fri Aug 15 14:45:00 BST 2014')
INSERT INTO [ontology] VALUES (2184007,'FBcv','1','0','Flybase Controlled Vocabulary','','http://svn.code.sf.net/p/fbcv/code-0/releases/fbcv-simple.obo','A structured controlled vocabulary used for various aspects of annotation by FlyBase. This ontology is maintained by FlyBase for various aspects of annotation not covered, or not yet covered, by other OBO ontologies. If and when community ontologies are available for the domains here covered FlyBase will use them.','9/24/2014 12:00:00 AM','Tue Sep 16 13:31:00 BST 2014')
