INSERT INTO [ontology] VALUES (2239006,'IMR','1','0','Molecule Role (INOH)','','http://obo.cvs.sourceforge.net/obo/obo/ontology/genomic-proteomic/molecule_role.obo','A structured controlled vocabulary of concrete protein names and generic (abstract) protein names. This ontology is a INOH pathway annotation ontology, one of a set of ontologies intended to be used in pathway data annotation to ease data integration. This ontology is used to annotate protein names, protein family names, generic/concrete protein names in the INOH pathway data.','11/12/2014 12:00:00 AM','Wed Nov 12 10:35:01 GMT 2014')
