INSERT INTO [ontology] VALUES (2295002,'UBERON','1','0','Uber anatomy ontology','','http://obo.svn.sourceforge.net/viewvc/obo/uberon/trunk/basic.obo','Uberon is a multi-species anatomy ontology created to facilitate comparison of phenotypes across multiple species. Uberon is generated semi-automatically from the union of existing species-centric anatomy ontologies.','6/6/2015 12:00:00 AM','Mon May 25 12:33:00 BST 2015')
